Voila des bords du Tybre, aux nuages du Xanthe;
Qui par tout ſurmonta les obſtacles offerts,

A laiſſé choir vn Sceptre, & s'eſt ſoumiſe aux fers:
Ta fraude, ie l'aduouë, a vaincu ma prudence;
